ailable. We’ve made a number of changes over the last week since RC2 that we can’t wait to get into your hands. Hope you’re ready to do some testing! Final UI improvements for the new media manager, based on lots of great feedback. Show more information about [&hellip;]</div></li><li><a class=\'rsswidget\' href=\'http://wordpress.org/news/2012/11/wordpress-3-5-release-candidate-2/\' title=\'The second release candidate for WordPress 3.5 is now available for download and testing. We’re still working on about a dozen remaining issues, but we hope to deliver WordPress 3.5 to your hands as early as next week. If you’d like to know what to test, visit the About page ( → About in the toolbar) and check out [&hellip;]\'>WordPress 3.5 Release Candidate 2</a> <span class=\"rss-date\">November 29, 2012</span><div class=\'rssSummary\'>The second release candidate for WordPress 3.5 is now available for download and testing. We’re still working on about a dozen remaining issues, but we hope to deliver WordPress 3.5 to your hands as early as next week. If you’d like to know what to test, visit the About page ( → About in the toolbar) and check out [&hellip;]</div></li></ul></div>','no'),(524,'_transient_timeout_feed_a5420c83891a9c88ad2a4f04584a5efc','1355133053','no'),(525,'_transient_feed_a5420c83891a9c88ad2a4f04584a5efc','a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n	\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:72:\"\n		\n		\n		\n		\n		\n		\n				\n\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n\n	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"WordPress Plugins » View: Most Popular\";s:7:\"attribs\";a:0