/h3>\n<ul>\n<li>Fixed an issue where stats couldn&#8217;t be loaded on some Jetpack sites.</li>\n<li>The app now remembers the previously opened blog.</li>\n<li>Removed the support for the AtomPub protocol since it will be removed in WordPress 3.5.</li>\n<li>Performance and reliability improvements.</li>\n</ul>\n<p>We also added a small patch for the picture uploading issue that some users are still experiencing on WordPress.com.</p>\n<h3>Version 2.2.4 of WordPress for PlayBook is available for download on the RIM <a href=\"http://appworld.blackberry.com/webstore/content/78913/\">AppWorld</a>.</h3>\n<p>What&#8217;s new in version 2.2.4:</p>\n<ul>\n<li>Thai language support.</li>\n<li>Fix for loading all pages.</li>\n<li>Post title added when viewing a comment.</li>\n<li>Images now link to themselves to better support image lightbox plugins.</li>\n<li>Fix for duplicate image uploads.</li>\n<li>Support for BlackBerry 10 Devices.</li>\n</ul>\n<p>We’ve also released the binary package for the new BB10 devices. If you own one of these prototypes, let us know what do you think about the app!</p>\n<br />  <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=blackberry.wordpress.org&blog=8247031&post=658&subd=wpblackberry&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 06 Dec 2012 22:40:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Cheri Lucas\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"WPTavern: How To Become A Top WordPress Professional\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://www.wptavern.com/?p=6705\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:104:\"http://feedproxy.google.com/~r/WordpressTavern/~3/Yfv0JdyJQI4/how-to-become-a-top-wordpress-professional\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1396:\"<p>Siobhan McKeown who I&#8217;ve noticed has made a name for herself within the WordPress community over the past two years has published an excellent guide with all sorts of tips on how to become <a href=\"http://wp.smashingmagazine.com/2012/12/05/become-top-wordpress-professional/\">one of the top WordPress professionals</a>. While she nails it on multiple levels, I have a tip or two of my own. First, it&#8217;s WordPress with a capital P, dangit. Secondly, make sure you use the <a href=\"http://wordpress.org/about/logos/\">correct WordPress logo</a> or else you&#8217;ll look stupid within the WordPress community and serious players will fail to take you seriously.  Last but not least, do not use the word WordPress within the domain name. For example, www.wordpressdevelopers.com. This is considered <a href=\"http://wordpress.org/about/domains/\">trademark infringement</a> and is another way for no one within the WordPress community to take you seriously. </p>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/top-5-wordpress-security-tips-you-most-likely-dont-follow\" rel=\"bookmark\" title=\"Top 5 WordPress Security Tips You Most Likely Don&#8217;t Follow\">Top 5 WordPress Security Tips You Most Likely Don&#8217;t Follow</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/Yfv0JdyJQI4\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 06 Dec 2012 20:16:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Jeffro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPTavern: Matt Mullenweg Interviewed By Om Malik At LeWeb\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://www.wptavern.com/?p=6700\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"http://feedproxy.google.com/~r/WordpressTavern/~3/b-hJtH1PfC8/matt-mullenweg-interviewed-by-om-malik-at-leweb\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1454:\"<p>In what is being considered one of the more interesting conversations at Le Web this year according to what I&#8217;ve read on Twitter, Om Malik And Matt Mullenweg discussed a number of things revolving around WordPress. While there were a number of tidbits to take away from their conversation, my favorite is Matt&#8217;s comments regarding the mobile usage of WordPress.</p>\n<blockquote><p>Mobile is giving us a chance to re-imagine the interface of WordPress from the ground up</p></blockquote>\n<p>To follow that statement, Matt also said that Automattic currently has more employees working on the various mobile applications versus the core of WordPress. </p>\n<div class=\"aligncenter\"></div>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/matt-mullenweg-interviewed-by-kteh\" rel=\"bookmark\" title=\"Matt Mullenweg Interviewed By KTEH\">Matt Mullenweg Interviewed By KTEH</a></li>\n<li><a href=\"http://www.wptavern.com/wpweekly-episode-52-matt-mullenweg-interview\" rel=\"bookmark\" title=\"WPWeekly Episode 52 &#8211; Matt Mullenweg Interview\">WPWeekly Episode 52 &#8211; Matt Mullenweg Interview</a></li>\n<li><a href=\"http://www.wptavern.com/sitepoint-interview-with-matt-mullenweg\" rel=\"bookmark\" title=\"Sitepoint Interview With Matt Mullenweg\">Sitepoint Interview With Matt Mullenweg</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/b-hJtH1PfC8\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 06 Dec 2012 15:55:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Jeffro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"Dougal Campbell: Giving back. For free!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"http://dougal.gunters.org/?p=72205\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"http://dougal.gunters.org/blog/2012/12/06/giving-back-for-free/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2461:\"<div class=\"featured-image align-right\"><img width=\"240\" height=\"240\" src=\"http://maxcdn.gunters.org/wordpress/wp-content/uploads/2012/12/XmasTree_68612-240x240.jpg?c9421e\" class=\"attachment-post-thumbnail wp-post-image\" alt=\"Get into the holiday spirit!\" /></div><p>Every once in a while, someone writes a post about how we should show some love to WordPress developers who put out free plugins and themes. &#8220;Go to their site, make a donation! Even just a few dollars is good!&#8221; But sometimes, it can be hard to spare even a few dollars. For some of us, $10 is a dessert after a nice steak dinner at a restaurant. For others, $10 is our kid&#8217;s school lunch for three days. Or maybe we just hate filling out and submitting the form for PayPal or whatever online payment system the developer uses for that purpose.</p>\n<p>But, what if there was a way to quickly and easily show a little love without having to fill out forms, <em>or even spend any extra money</em>? In many cases, there is such a thing: affiliate links. Look at your favorite developer&#8217;s web site. Do you see any ads or links to Amazon.com, ThinkGeek.com, or similar sites there? Even if the particular product listed there isn&#8217;t something you plan to buy, do you plan to buy <em>anything</em> from that site? Then when you&#8217;re ready to purchase those books for your nephew, or that Doctor Who Sonic Screwdriver for your niece, use the developer&#8217;s affiliate links to do it. Click their link, search for your stuff, and buy what you were already planning to buy anyways. They will get a tiny kickback from your purchase, without any extra money coming out of your pocket. You can donate without making a direct donation. It might not be much, but it&#8217;s still better than nothing!</p>\n<p>Your favorite developer gets some love, your nephew gets some books, and you get to feel all warm inside. For free.</p>\n<p>Have a Merry Christmas, Happy Hanukkah, Joyous Kwanzaa, Blessed Ramadan, Happy Holidays, Good Winter Solstice or Festive Festivus!</p>\n<p>Original Article: <a href=\"http://dougal.gunters.org/blog/2012/12/06/giving-back-for-free/\">Giving back. For free!</a>\n<a href=\"http://dougal.gunters.org\">Dougal Campbell&#039;s geek ramblings - WordPress, web development, and world domination.</a></p><div class=\"yarpp-related-rss yarpp-related-none\">\n<h3>Related posts:</h3>\n<img src=\"http://yarpp.org/pixels/5db43ee24c4f1e1d0e45d08cc91b0130\" />\n</div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 06 Dec 2012 15:47:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Dougal Campbell\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WordPress.tv: Craig Taylor: Intro to WordPress Multisite\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=14409\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"x