;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"Weblog Tools Collection: WordPress Plugin Releases for 12/5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12305\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/TwmODgy-pQ4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2387:\"<h3>New plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/authy-for-wp/\"><strong>Authy for WordPress</strong></a> allows you to add <a href=\"https://www.authy.com\">Authy</a> two-factor authentication to your site.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/gc-message-bar/\"><strong>GC Message Bar</strong></a> lets you put a sticky message to the top or bottom of your site.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/jetpack-photon-for-nextgen-gallery/\"><strong>Jetpack Photon for NextGEN Gallery</strong></a> extends <a href=\"http://jetpack.me\">Jetpack&#8217;s</a> Photon CDN to images in <a href=\"http://wordpress.org/extend/plugins/nextgen-gallery/\">NextGEN Galleries</a>.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/wp-memory-db-indicator/\"><strong>Memory Load Consumption and db size Usage</strong></a> allows you display your site&#8217;s PHP Memory and Database usage in your Dashboard.</p>\n<h3>Updated plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/backwpup/\"><strong>BackWPup</strong></a> allows you to backup your WordPress database, files, and more.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/co-authors-plus/\"><strong>Co-Authors Plus</strong></a> allows you to assign multiple bylines to posts, pages, and custom post types via a search-as-you-type input box.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/facebook/\"><strong>Facebook</strong></a> makes your site deeply social by integrating functionality from Facebook.</p>\n<p><a href=\"http://www.fastsecurecontactform.com/\"><strong>Fast Secure Contact Form</strong></a> lets your visitors send you a quick e-mail message and blocks all common spammer tactics. Additionally, the plugin has a multi-form feature, optional extra fields, and an option to redirect visitors to any URL after the message is sent.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/keyring/\"><strong>Keyring</strong></a> provides a very hookable, completely customizable framework for connecting your WordPress site to an external service.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/yet-another-related-posts-plugin/\"><strong>Yet Another Related Posts Plugin</strong></a> displays a list of related entries on your site and feeds based on a unique algorithm.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/TwmODgy-pQ4\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 05 Dec 2012 14:00:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"WordPress.tv: Tony Cosentino: The Plugin Spectactula