tle\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"Akismet: Over 60 billion spams squashed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://blog.akismet.com/?p=770\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"http://blog.akismet.com/2012/12/04/60-billion/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2114:\"<p>It works while you work, it works while you sleep, during your vacation, your weekends, and never takes a day off. <a href=\"https://akismet.com/\">Akismet</a>, the best way to protect your online properties from spam, recently hit an incredible milestone we&#8217;re delighted to share: over <strong>60 billion spam  comments, forum comments, blog posts, pingbacks, trackbacks, and tweets squashed on sight.</strong> Boom!</p>\n<p><a href=\"http://blog.akismet.com/2012/12/04/60-billion/118million/\" rel=\"attachment wp-att-784\"><img src=\"http://akismet.files.wordpress.com/2012/12/118million.jpg?w=300&h=116\" alt=\"118million\" width=\"300\" height=\"116\" class=\"alignnone size-medium wp-image-784\" /></a></p>\n<p>Just how many is 60 billion? Well, let&#8217;s say we equate one spam to one mile. 60 billion miles would take you to the sun 645 times. Akismet continues to squash more and more spam by the minute. In fact, back when we hit our <a href=\"http://blog.akismet.com/2012/05/30/50-billion-little-piece/\">50 billion spam milestone</a>, we were catching about 700 spams per second. In November 2012 alone, we caught three billion bits of spam, which is 100 million spams per day. Per. Day. That&#8217;s 1200 spams per second. Blink: Akismet just nabbed 1200 spam. Incredible, yes? </p>\n<p>Akismet works with WordPress and <a href=\"http://akismet.com/development/\">many other platforms</a>. If you don&#8217;t see your platform on the list, all you need do is <a href=\"https://akismet.com/signup/\">grab an API key</a> and get coding.  </p>\n<p>Akismet is 100% free as in air, free as in birds for individual users&#8217; personal use. Check out our professional / business plans: <a href=\"https://akismet.com/signup/\">sign up and say adios to spam</a>.</p>\n<br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/akismet.wordpress.com/770/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/akismet.wordpress.com/770/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=blog.akismet.com&blog=116920&post=770&subd=akismet&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 04 Dec 2012 23:04:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Alex\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPTavern: How To Be A More Productive WordPress Publisher\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://www.wptavern.com/?p=6697\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"http://feedproxy.google.com/~r/WordpressTave