/BzOCfoNIMHc/most-important-theme-feature-of-2012\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1623:\"<p><a href=\"http://www.wptavern.com/wp-content/uploads/2012/12/wphublogo.jpg\" rel=\"thumbnail\"><img src=\"http://www.wptavern.com/wp-content/uploads/2012/12/wphublogo.jpg\" alt=\"WPHub.com Logo\" title=\"wphublogo\" width=\"224\" height=\"58\" class=\"alignright size-full wp-image-6693\" /></a>WPHub.com is hosting a <a href=\"http://www.wphub.com/most-important-theme-features-2012-poll/\">poll right now</a> that asks, <strong>What Has Been The Most Important WP Theme Feature In 2012</strong>? Out of the choices listed, I voted for Responsive Design because of the prolific usage of Tablets and smartphones versus the traditional desktop computer. On that note, I think it was a very wise choice to have the new default theme in WordPress 3.5 have a responsive design by default. After you place your vote, feel free to come on back in the comments section and explain why you voted for that choice. </p>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/vote-for-the-new-header-design\" rel=\"bookmark\" title=\"Vote For The New Header Design\">Vote For The New Header Design</a></li>\n<li><a href=\"http://www.wptavern.com/matt-mullenweg-to-be-in-charge-of-the-2012-default-theme\" rel=\"bookmark\" title=\"Matt Mullenweg To Be In Charge Of The 2012 Default Theme\">Matt Mullenweg To Be In Charge Of The 2012 Default Theme</a></li>\n<li><a href=\"http://www.wptavern.com/theme-fm-theme-store-reopens\" rel=\"bookmark\" title=\"Theme.FM Theme Store Reopens\">Theme.FM Theme Store Reopens</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/BzOCfoNIMHc\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}