Ed Nailor- Truly Dynamic Sidebars.m4v\" src=\"http://videos.videopress.com/ldYw31W5/video-972cb6706f_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 04 Dec 2012 15:11:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"Weblog Tools Collection: WordPress 3.5 RC 3 Released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12300\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/F1VryC7Gss4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1263:\"<p><a href=\"http://wordpress.org/\">WordPress</a> 3.5 RC 3 <a href=\"http://wordpress.org/news/2012/12/wordpress-3-5-release-candidate-3/\">has been released</a>.</p>\n<p>This RC is quite polished, and it looks like the final WordPress 3.5 release may be just a few days away judging by their previous timeline. The new Media interface has received a few more enhancements, uploading errors are now more specific, and various mobile device and Internet Explorer bugs have been fixed.</p>\n<p>This is most likely the last WordPress 3.5 RC before the final release hits, so if you&#8217;re plugin or theme developer who doesn&#8217;t like surprises on launch day, you should definitely test your products now.</p>\n<p>If you run into any bugs, please check the <a href=\"http://core.trac.wordpress.org/report/5\">known</a> and <a href=\"http://core.trac.wordpress.org/query?status=closed&group=component&milestone=3.5\">fixed</a> issues first, <a href=\"http://codex.wordpress.org/Reporting_Bugs\">report them</a> if they have not already been reported, and visit <a href=\"http://wordpress.org/support/forum/alphabeta\">the support forums</a> if you need any help.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/F1VryC7Gss4\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 04 Dec 2012 15:00:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Dev Blog: WordPress 3.5 Release Candidate 3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"http://wordpress.org/news/2012/12/wordpress-3-5-release-candidate-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"http://wordpress.org/news/2012/12/wordpress-3-5-release-candidate-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1892:\"<p>The third release candidate for WordPress 3.5 is now available. We&#8217;ve made a number of changes over the last week since <a title=\"WordPress 3.5 Release Candidate 2\" href=\"http://wordpress.org/news/2012/11/wordpress-3-5-release-candidate-2/\">RC2</a> that we can&#8217;t wait to get into your hands. Hope you&#8217;re ready to do some testing!</p>\n<ul>\n<li><span>Final UI improvements for the new media manager, based on lots of great feedback.</span></li>\n<li>Show more information about uploading errors when they occur.</li>\n<li>When inserting an image into a post, don&#8217;t forget the alternative text.</li>\n<li>Fixes for the new admin button styles.</li>\n<li>Improvements for mobile devices, Internet Explorer, and right-to-left languages.</li>\n<li>Fix cookies for subdomain installs when multisite is installed in a subdirectory.</li>\n<li>Fix ms-files.php rewriting for very old multisite installs.</li>\n</ul>\n<p>At this point, we only have a <a href=\"http://core.trac.wordpress.org/report/5\">few minor issues</a> left. If all goes well, you will see WordPress 3.5 very soon. If you run into any issues, please post to the <a href=\"http://wordpress.org/support/forum/alphabeta/\">Alpha/Beta area in the support forums</a>.</p>\n<p>If you&#8217;d like to know what to test, visit the About page (<strong><img alt=\"\" src=\"http://wordpress.org/wp-content/themes/twentyten/images/wordpress.png\" /> → About</strong> in the toolbar) and check out the list of features. This is still development software, so your boss may get mad if you install this on a live site. To test WordPress 3.5, try the <a href=\"http://wordpress.org/extend/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin (you&#8217;ll want &#8220;bleeding edge nightlies&#8221;). Or you can <a href=\"http://wordpress.org/wordpress-3.5-RC3.zip\">download the release candidate here (zip)</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 04 Dec 2012 08:37:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Andrew Nacin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"WPTavern: The Last 10 Things You Need To Know About WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://www.wptavern.com/?p=6687\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:113:\"http://feedproxy.google.com/~r/WordpressTavern/~3/TbEGz8ledPs/the-last-10-things-you-need-to-know-about-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2093:\"<p>On what has been a longstanding tradition, Aaron Brazell of Technosailor.com has published his list of <a href=\"http://technosailor.com/2012/12/03/10-things-you-need-to-know-about-wordpress-3-5/\">10 things you&#8217;ll need to know</a> regarding WordPress 3.5. Unfortunately, he also announced that it would be his last one. </p>\n<blockquote><p>For 7 years, I’ve been publishing these articles every time a new version of WordPress comes out. Since version 2.0. It’s been a long run. It began as a need to fill people in about new features in WordPress (and there were a lot in 2.0). There wasn’t anybody doing these at the time, and certainly WordPress wasn’t nearly as popular as it is now (22% of the internet is powered by WordPress).</p>\n<p>But many more people have stepped up in recent releases and have started updating readers with new features and expectations. My job here is done. I’m passing the baton but really the baton has already been passed and I’m happy about that. This will be my final 10 things article. Thank you for sticking around and following along all these years.</p></blockquote>\n<p>I want to personally thank Aaron for putting together those 10 things posts as they were always a highlight to read as well as signaling that the next major release of WordPress was very imminent. </p>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/things-you-should-know-about-wordpress-3-3\" rel=\"bookmark\" title=\"Things You Should Know About WordPress 3.3\">Things You Should Know About WordPress 3.3</a></li>\n<li><a href=\"http://www.wptavern.com/have-you-pre-ordered-your-wordpress-bible\" rel=\"bookmark\" title=\"Have You Pre-ordered Your WordPress Bible?\">Have You Pre-ordered Your WordPress Bible?</a></li>\n<li><a href=\"http://www.wptavern.com/wordpress-27-a-milestone-in-its-own-right\" rel=\"bookmark\" title=\"WordPress 2.7 A Milestone In Its Own Right\">WordPress 2.7 A Milestone In Its Own Right</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/TbEGz8ledPs\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 03 Dec 2012 16:25:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Jeffro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"WPTavern: WordPress For iOS 3.3 Released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://www.wptavern.com/?p=6683\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"http://feedproxy.google.com/~r/WordpressTavern/~3/TsVUg2Kooqk/wordpress-for-ios-3-3-released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1729:\"<p><a href=\"http://www.wptavern.com/wp-content/uploads/2012/12/WordPressForIOS3.3.jpg\" rel=\"thumbnail\"><img src=\"http://www.wptavern.com/wp-content/uploads/2012/12/WordPressForIOS3.3.jpg\" alt=\"WordPress For iOS 3.3 Logo\" title=\"WordPressForIOS3.3\" width=\"137\" height=\"52\" class=\"alignright size-full wp-image-6684\" /></a>The WordPress iOS team has <a href=\"http://ios.wordpress.org/2012/12/03/version-3-3/\">released version 3.3</a> of the popular mobile app. Thanks to 3.3, the app now has sounds such as clicks, refreshes and a crumple sound when you discard panels on the iPad. Since I use my iPhone on vibrate all the time, the sounds are a minor addition. However, they are a nice touch for the app overall. Outside of the addition of sounds, the release boasts more than 20 bug fixes and stability improvements. The next version looks like it will include a new Notification feature for WordPress.com and Jetpack enabled blogs. A new Visual editor is also in the works. </p>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/wordpress-iphone-app-2-7-released\" rel=\"bookmark\" title=\"WordPress iPhone App 2.7 Released\">WordPress iPhone App 2.7 Released</a></li>\n<li><a href=\"http://www.wptavern.com/beta-team-being-established-for-wordpress-ios\" rel=\"bookmark\" title=\"Beta Team Being Established For WordPress iOS\">Beta Team Being Established For WordPress iOS</a></li>\n<li><a href=\"http://www.wptavern.com/managewp-to-soon-be-available-as-an-ios-app\" rel=\"bookmark\" title=\"ManageWP To Soon Be Available As An iOS App\">ManageWP To Soon Be Available As An iOS App</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/TsVUg2Kooqk\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 03 Dec 2012 16:03:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Jeffro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPTavern: WebDevStudios Acquires Startbox Theme Framework\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://www.wptavern.com/?p=6678\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"http://feedproxy.google.com/~r/WordpressTavern/~3/lOPXUliyAj8/webdevstudios-acquires-startbox-theme-framework\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4511:\"<p><a href=\"http://www.wptavern.com/wp-content/uploads/2012/12/startboxlogo.jpg\" rel=\"thumbnail\"><img src=\"http://www.wptavern.com/wp-content/uploads/2012/12/startboxlogo.jpg\" alt=\"Startbox Theme Framework Logo\" title=\"startboxlogo\" width=\"272\" height=\"57\" class=\"alignright size-full wp-image-6679\" /></a>A few days ago, <a href=\"http://webdevstudios.com/2012/11/28/startbox-finds-a-new-home-with-webdevstudios/\">WebDevStudios announced</a> that they acquired the <a href=\"http://wpstartbox.com\">Startbox</a> theme framework. I&#8217;ve known WebDevStudios to primarily be a client development oriented business so I thought it was interesting that they have decided to move in the direction of a commercial theme shop. I managed to get Brad to answer a few questions I had regarding the acquisition and this is what he had to say:  </p>\n<p><strong>With the acquisition of StartBox, does this officially make WebDevStudios a commercial theme shop? </strong></p>\n<p>Technically yes, however I don&#8217;t feel we are out there to compete with the many successfully established theme shops in the community.  There are a ton of great themes and frameworks out there, so it really comes down to what is the best fit for the person or project. StartBox is our first major push into the commercial WordPress space. Our goal is to focus on making the StartBox theme framework as amazing as possible. Everything else is just gravy.</p>\n<p><strong>Will you be sticking with the Theme Club idea already established by StartBox?</strong></p>\n<p>For now yes, but that could change in the future. Currently you can access all child themes for $100/year or purchase any single child theme for $47.  We currently have 9 child themes available, but plan on rapidly expanding that in 2013. The StartBox core framework is also 100% freely available via Github: <a href=\"https://github.com/WebDevStudios/StartBox\">https://github.com/WebDevStudios/StartBox</a></p>\n<p>At WebDevStudios, we pride ourselves on having a strong focus on development. Because of that we plan on making some really amazing child themes and utilize those strong development skills to include features that go above and beyond what users might see in other themes out there. These themes and features will also carry over into our client work so it&#8217;s really a win win for us.</p>\n<p><strong>Will all previous plugins created by WebDevStudios be moved under the StartBox club umbrella? </strong></p>\n<p>We don&#8217;t have any plans to move our existing plugins to the theme club. We are working on a few pro versions of our plugins, but the base plugins will always remain free and available on WordPress.org. We do have plans to build plugins specifically for StartBox. If a StartBox plugin would be useful in other themes, and not just a feature specific to StartBox, we plan on coding and releasing it for everyone to use.</p>\n<p><strong>When I think of WebDevStudios, the thing that pops into my mind first is the Genesis Theme Framework. Will Genesis no longer be the framework of choice for future client work?</strong></p>\n<p>We love Genesis and that doesn&#8217;t change because of StartBox. Going forward we do plan on using StartBox for most client work, but ultimately will use whatever theme is a good fit for the project. A good amount of our contacts come to us wanting Genesis, so we will certainly give them what they want.</p>\n<p>The beauty of StartBox is it allows us to not only shape the future of the theme framework, but also build and sell really amazing child themes for StartBox. We&#8217;ve given a lot of consideration to building and selling stand-alone themes and custom child themes for other frameworks, but at the end of the day we decided to focus on a framework that we have full control over.  </p>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/which-theme-framework-to-use\" rel=\"bookmark\" title=\"Which Theme Framework To Use?\">Which Theme Framework To Use?</a></li>\n<li><a href=\"http://www.wptavern.com/what-exactly-is-the-carrington-framework\" rel=\"bookmark\" title=\"What Exactly Is The Carrington Framework?\">What Exactly Is The Carrington Framework?</a></li>\n<li><a href=\"http://www.wptavern.com/my-thoughts-on-the-atlas-theme-framework\" rel=\"bookmark\" title=\"My Thoughts On The Atlas Theme Framework\">My Thoughts On The Atlas Theme Framework</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/lOPXUliyAj8\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 03 Dec 2012 13:47:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Jeffro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"WordPress.tv: Michelle Gower: A to Published (in less than 24 Hours)\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=14343\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s