{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"http://ios.wordpress.org/?p=1311\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"http://ios.wordpress.org/2012/12/03/version-3-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3462:\"<p><a href=\"http://wpiphone.files.wordpress.com/2012/11/wpios-3-3-sounds.jpg\"><img class=\"alignright size-medium wp-image-1336\" alt=\"Version 3.3 of WordPress for iOS: Sound effects\" src=\"http://wpiphone.files.wordpress.com/2012/11/wpios-3-3-sounds.jpg?w=240&h=517\" height=\"517\" width=\"240\" /></a>Since the release of version 3.2 the team has been hard at work on several new features. Today we&#8217;re we&#8217;re happy to announce that the first &#8212; in-app Sounds &#8212; is <a href=\"https://itunes.apple.com/us/app/wordpress/id335703880?mt=8\">now available in version 3.3</a>. Adding sounds to the app has been on our wish list a long time, and while this is a modest update, we hope you will enjoy it!</p>\n<h3>Sounds</h3>\n<p>There are five new sounds created by the talented <a href=\"http://www.joshmobley.com/\">Josh Mobley</a> in the app:</p>\n<ul>\n<li>You&#8217;ll hear a swish sound when you open a panel on the iPhone, or tap a menu item on the iPad.</li>\n<li>A pulling sound plays when you pull down to refresh content.</li>\n<li>Once the refresh completes you&#8217;ll hear a click.</li>\n<li>When you receive a new comment a chime will let you know about it immediately.</li>\n<li>The app now makes a crumple sound when you discard panels on the iPad.</li>\n</ul>\n<p>Our goal is to provide elegant sounds that enhance your experience with WordPress for iOS, but you can mute the new sounds from the Settings screen if you prefer a silent app. Your device&#8217;s mute button will silence the app as well.</p>\n<h3>Stability Improvements</h3>\n<p>In addition to the new sounds effects, we continue to make the app even more stable. In this release we fixed a total of <a href=\"http://ios.trac.wordpress.org/milestone/3.3\">21 issues</a>.</p>\n<h3>Next Up</h3>\n<p>A new Notifications feature for WordPress.com and <a href=\"http://jetpack.me\">Jetpack-enabled</a> blogs is nearing completion. We also have a visual editor in the works, which we&#8217;re very excited about. If these are features you&#8217;re interested in helping with, or if you have a different feature or improvement in mind, the time to help make WordPress for iOS amazing is NOW! Drop us a note on our <a href=\"http://dev.ios.wordpress.org/\">dev blog</a> or chime in at <a href=\"http://make.wordpress.org/mobile\">make/mobile on WordPress.org</a> and we&#8217;ll help you get started as a contributor!</p>\n<p>A huge thanks to the contributors that worked on this release: <a href=\"http://wordpress.org/support/profile/koke\">koke</a>, <a href=\"http://wordpress.org/support/profile/aerych\">aerych</a>, <a href=\"http://wordpress.org/support/profile/mrroundhill\">mrroundhill</a>, fklu, <a href=\"http://wordpress.org/support/profile/jkudish\">jkudish</a>, <a href=\"http://wordpress.org/support/profile/daniloercoli\">daniloercoli</a>, <a href=\"http://wordpress.org/support/profile/isaackeyet\">isaackeyet</a>, and <a href=\"http://www.joshmobley.com/\">jmobb</a>.</p>\n<p>What do you think of the new sound effects? Drop a comment here or follow us on <a href=\"https://twitter.com/WordPressiOS\">@WordPressiOS</a> to let us know!</p>\n<br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wpiphone.wordpress.com/1311/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wpiphone.wordpress.com/1311/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=ios.wordpress.org&bl