ure that the Codex has all of the necessary information pertaining to the new release. So far, there is a hefty list of items that need to be added or amended in the Codex, especially as it pertains to media. You are encouraged to add to the list or if you&#8217;re a member of the Codex, to begin adding the necessary information. </p>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/beta-team-being-established-for-wordpress-ios\" rel=\"bookmark\" title=\"Beta Team Being Established For WordPress iOS\">Beta Team Being Established For WordPress iOS</a></li>\n<li><a href=\"http://www.wptavern.com/is-a-plugin-validation-team-a-pipe-dream\" rel=\"bookmark\" title=\"Is A Plugin Validation Team A Pipe Dream?\">Is A Plugin Validation Team A Pipe Dream?</a></li>\n<li><a href=\"http://www.wptavern.com/more-info-on-the-handbook-project\" rel=\"bookmark\" title=\"More Info On The Handbook Project\">More Info On The Handbook Project</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/lry_PYfjwNk\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 30 Nov 2012 23:48:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Jeffro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WordPress.tv: Andy Nathan: Building Serious Blog Traffic\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit