iginal.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 29 Nov 2012 06:27:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WPTavern: Comparison Spreadsheet For Content Type And Custom Field Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://www.wptavern.com/?p=6642\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:126:\"http://feedproxy.google.com/~r/WordpressTavern/~3/7ZX1WEqgUcg/comparison-spreadsheet-for-content-type-and-custom-field-plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1990:\"<p>If you&#8217;re looking to use a Content Type or Custom Field plugin, your first stop should be <a href=\"https://docs.google.com/spreadsheet/ccc?key=0AoY8IFUX301qdFhBaERLUEUwa3U0YjFYTnBmaU1mbmc#gid=3\">this large comparison spreadsheet</a> produced by Scott Kingsley Clark, Matt Gibbs and other plugin authors. The comparison spreadsheet shows the differences between the various plugins at a high level. Unfortunately, I can&#8217;t determine when this document was last updated or find an explanation of the various fields represented. For example, one of the fields talks about whether the team contributed back to the WordPress core. It would be interesting to know the qualifications for contributing back to core. </p>\n<p><a href=\"http://www.wptavern.com/wp-content/uploads/2012/11/plugincomparisonspreadsheet.jpg\" rel=\"thumbnail\"><img src=\"http://www.wptavern.com/wp-content/uploads/2012/11/plugincomparisonspreadsheet.jpg\" alt=\"Plugin Comparison Sheet\" title=\"plugincomparisonspreadsheet\" width=\"586\" height=\"334\" class=\"aligncenter size-full wp-image-6643\" /></a></p>\n<p>With so many plugins in existence that aim to serve the same purpose, more informative spreadsheets like these would definitely be beneficial for the community. </p>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/500-plugins-to-possibly-be-purged-from-the-repository\" rel=\"bookmark\" title=\"500 Plugins To Possibly Be Purged From The Repository\">500 Plugins To Possibly Be Purged From The Repository</a></li>\n<li><a href=\"http://www.wptavern.com/core-plugins-never-gonna-happen\" rel=\"bookmark\" title=\"Core Plugins? Never Gonna Happen!\">Core Plugins? Never Gonna Happen!</a></li>\n<li><a href=\"http://www.wptavern.com/canonical-core-something-plugins\" rel=\"bookmark\" title=\"Canonical, Core, Something Plugins\">Canonical, Core, Something Plugins</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/7ZX1WEqgUcg\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 28 Nov 2012 20:56:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Jeffro\";s:7:\"attribs\";a:0