7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"Weblog Tools Collection: WordPress Plugin Releases for 11/27\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12277\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/HBA6W9LK5m8/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1082:\"<h3>New plugins</h3>\n<p><a href=\"http://www.knewsplugin.com/\"><strong>Knews Multilingual Newsletters</strong></a> allows you to build multilingual professional looking newsletters.</p>\n<p><a href=\"http://sharp-coders.com/plugins/wp-plugins/wp-subscriber-form\"><strong>WP Subscriber Form</strong></a> adds a subscription form to the end of your content.</p>\n<h3>Updated plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/backwpup/\"><strong>BackWPup</strong></a> allows you to backup your WordPress database, files, and more.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/theme-check/\"><strong>Theme-Check</strong></a> allows you to run checks on the current theme before uploading to WordPress. This plugin uses the same API and is kept more or less in sync with the WordPress.org uploader tool.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/wp-slimstat/\"><strong>WP SlimStat</strong></a> is a simple but powerful web analytics plugin for WordPress.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/HBA6W9LK5m8\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 27 Nov 2012 14:00:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"WPTavern: 300 Free Icons For Web And User Interface Design\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://www.wptavern.com/?p=6635\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:110:\"http://feedproxy.google.com/~r/WordpressTavern/~3/U_G7_kMCOQA/300-free-icons-for-web-and-user-interface-design\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1979:\"<p>Adam Whitcroft has released a 300 icon kit for web and user interface design called <a href=\"http://adamwhitcroft.com/batch/\">Batch</a>. Each icon is a single Photoshop layer making blend modes and scaling a breeze. <del>According to the license, WordPress theme or plugin authors should be able to use these in their works:</del></p>\n<blockquote><p>You are free to use Batch (the &#8220;icon set&#8221;) or any part thereof (the &#8220;icons&#8221;) in any personal, open-source or commercial work without obligation of payment (monetary or otherwise) or attribution. Do not sell the icon set, host the icon set or rent the icon set (either in existing or modified form).</p>\n<p>While attribution is optional, it is always appreciated.</p>\n<p>Intellectual property rights are not transferred with the download of the icons.</p></blockquote>\n<p><a href=\"http://www.wptavern.com/wp-content/uploads/2012/11/batchiconset.jpg\" rel=\"thumbnail\"><img src=\"http://www.wptavern.com/wp-content/uploads/2012/11/batchiconset.jpg\" alt=\"Batch Icon Set\" title=\"batchiconset\" width=\"467\" height=\"264\" class=\"aligncenter size-full wp-image-6636\" /></a></p>\n<p>This icon set previously had a price tag attached to it. Adam <a href=\"http://adamwhitcroft.com/2012/11/on-batch/\">explained</a> why that&#8217;s not the case anymore.</p>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/studiopress-releases-simple-social-icons-plugin\" rel=\"bookmark\" title=\"StudioPress Releases Simple Social Icons Plugin\">StudioPress Releases Simple Social Icons Plugin</a></li>\n<li><a href=\"http://www.wptavern.com/interview-with-paul-mycroft-on-the-erosion-of-his-web-design-business\" rel=\"bookmark\" title=\"Interview With Paul Mycroft On The Erosion Of His Web Design Business\">Interview With Paul Mycroft On The Erosion Of His Web Design Business</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/U_G7_kMCOQA\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 27 Nov 2012 09:53:24 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Jeffro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPTavern: What Developers Should Know About WordPress 3.5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://www.wptavern.com/?p=6630\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"http://feedproxy.google.com/~r/WordpressTavern/~3/ZPa7lNwpTYA/what-developers-should-know-about-wordpress-3-5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2159:\"<p><a href=\"http://www.wptavern.com/wp-content/uploads/2012/11/oneextrapixellogo.jpg\" rel=\"thumbnail\"><img src=\"http://www.wptavern.com/wp-content/uploads/2012/11/oneextrapixellogo-300x63.jpg\" alt=\"One Extra Pixel.com Logo\" title=\"oneextrapixellogo\" width=\"300\" height=\"63\" class=\"alignright size-medium wp-image-6631\" /></a>Oneextrapixel.com has a <a href=\"http://www.onextrapixel.com/2012/11/26/whats-new-in-wordpress-3-5-the-developers-perspective/\">list of things</a> that WordPress developers will need to know about concerning WordPress 3.5. However, end users are able to pick up a few things as well, especially the part about settings changes. According to the site, the admin page dedicated to Privacy settings has disappeared. The options on that page have been moved to the Reading Settings area. Also for new installs, the ability to change the Character set has been hidden and will use UTF-8 by default. I think this makes total sense and would like to see similar option UI be removed in the future. Even though the UI will be hidden, you can still access the option via options.php. Going this route seems similar to how FireFox works. While there are things to configure, those who want access to everything can go into <strong>About:config</strong>. </p>\n<p>Over the years, the saying has been, &#8220;<strong>Decisions, not options</strong>&#8220;. I wonder when options.php will be renamed to decisions.php. </p>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/what-devpress-thinks-wordpress-needs\" rel=\"bookmark\" title=\"What Dev4Press Thinks WordPress Needs\">What Dev4Press Thinks WordPress Needs</a></li>\n<li><a href=\"http://www.wptavern.com/wordpress-developers-that-are-hiring\" rel=\"bookmark\" title=\"WordPress Developers That Are Hiring\">WordPress Developers That Are Hiring</a></li>\n<li><a href=\"http://www.wptavern.com/why-wordpress-has-less-options-not-more\" rel=\"bookmark\" title=\"Why WordPress Has Fewer Options, Not More\">Why WordPress Has Fewer Options, Not More</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/ZPa7lNwpTYA\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 27 Nov 2012 09:32:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Jeffro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"