/*!40000 ALTER TABLE `wp_posts` DISABLE KEYS */;
INSERT INTO `wp_posts` VALUES (2,1,'2012-11-04 17:17:25','2012-11-04 17:17:25','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickies to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://toessay.co.uk.ben/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','open','open','','sample-page','','','2012-11-04 17:17:25','2012-11-04 17:17:25','',0,'http://toessay.co.uk.ben/?page_id=2',0,'page','',0),(7,1,'2012-11-04 21:04:33','2012-11-04 21:04:33','An international review dedicated to the essay. Authors write from the world over.','About TOE','','publish','open','open','','about','','','2012-11-04 21:06:57','2012-11-04 21:06:57','',0,'http://toessay.co.uk.ben/?page_id=7',0,'page','',0),(9,1,'2012-11-04 21:04:52','2012-11-04 21:04:52','','Contact','','publish','open','open','','contact','','','2012-11-04 21:04:52','2012-11-04 21:04:52','',0,'http://toessay.co.uk.ben/?page_id=9',0,'page','',0),(19,1,'2012-11-04 21:12:31','2012-11-04 21:12:31','','Contact','','publish','open','open','','19','','','2012-11-22 00:21:25','2012-11-22 00:21:25','',0,'http://toessay.co.uk.ben/?p=19',2,'nav_menu_item','',0),(20,1,'2012-11-04 21:12:31','2012-11-04 21:12:31',' ','','','publish'